import React from "react";
import "./Home.css";
import {
  Box,
  Button,
  Container,
  Input,
  TextField,
  Typography,
} from "@mui/material";
import Instalogo from "../Assets/instagram-logo.png";
import FacebookIcon from "@mui/icons-material/Facebook";

const ariaLabel = { "aria-label": "description" };
export const Home = () => {
  return (
    <>
      <Container>
        <Box
          sx={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "100vh",
          }}
        >
          <Box
            sx={{
              height: "450px",
              width: "350px",
              border: "1px solid grey",
              padding: "25px 50px 25px 50px",
            }}
          >
            <Box className="instagram_content_center">
              <img src={Instalogo} alt="" />
            </Box>
            <Box sx={{ marginTop: "3rem" }}>
              <TextField
                variant="outlined"
                placeholder="Phone number, username, or email"
                inputProps={ariaLabel}
                sx={{
                  width: "100%",
                }}
              ></TextField>
            </Box>
            <Box sx={{ marginTop: "1rem" }}>
              <TextField
                variant="outlined"
                placeholder="Password"
                type="password"
                sx={{
                  width: "100%",
                  height: "20px",
                }}
              ></TextField>
            </Box>
            <Box sx={{ marginTop: "4rem" }}>
              <Button
                variant="contained"
                sx={{ width: "100%", borderRadius: "10px" }}
              >
                Log In
              </Button>
            </Box>
            <Box
              sx={{ marginTop: "1rem", display: "flex", flexDirection: "row" }}
            >
              <Box
                sx={{
                  top: "0.70rem",
                  height: "1px",
                  position: "relative",
                  flexGrow: "1",
                  backgroundColor: "grey",
                }}
              ></Box>
              <Box
                sx={{
                  marginInline: "18px",
                  display: "flex",
                  flexDirection: "column",
                }}
              >
                <Typography sx={{ color: "grey", fontWeight: "600" }}>
                  OR
                </Typography>
              </Box>
              <Box
                sx={{
                  top: "0.70rem",
                  height: "1px",
                  position: "relative",
                  flexGrow: "1",
                  backgroundColor: "grey",
                }}
              ></Box>
            </Box>
            <Box
              className="instagram_content_center"
              sx={{ marginTop: "1rem", color: "#385185" }}
            >
              <FacebookIcon></FacebookIcon>
              <Button
                variant="text"
                sx={{
                  color: "#385185",
                  fontWeight: "700",
                  textTransform: "capitalize",
                  fontSize: "1rem",
                }}
              >
                Log in with Facebook
              </Button>
            </Box>
            <Box
              className="instagram_content_center"
              sx={{ marginTop: "1rem", color: "#385185" }}
            >
              <Typography sx={{ fontWeight: "600", fontSize: "14px" }}>
                Forgot password?
              </Typography>
            </Box>
          </Box>

          <Box
          sx={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginBottom:'2rem'
          }}
        >
          <Box
            sx={{
              height: "150px",
              width: "350px",
              border: "1px solid grey",
              padding: "25px 50px 25px 50px",
            }}
          ></Box>
        </Box>
        </Box>
      </Container>
      {/* <Container>

      </Container> */}
    </>
  );
};
